@import './css/grabsingle.css';
/*简单初始化---star*/
ul {
  list-style: none;
  margin: 0;
  padding: 0;
}
/*简单初始化---end*/
.index {
  z-index: 10;
  width: 100%;
  min-width: 480px;
  height: 100%;
  background: #F6F8FF;
  padding: 15px;
  position: relative;
  display: flex;
  flex-flow: row nowrap;
  justify-content: space-between;
}
.content {
  width: 100%;
  height: 100%;
  min-width: 480px;
  background:rgba(255,255,255,1);
  box-shadow:0px 0px 25px 0px rgba(63,106,255,0.08);
  border-radius:6px;
  padding: 30px;
}
.content .title_name{
  width: 100%;
  min-width: 480px;
  height: 16px;
  font-size: 16px;
  font-family: PingFang SC;
  font-weight: 500;
  color: rgba(29,33,51,1);
}
.content ul{
  margin-top: 40px;
  min-width: 480px;
}
.content ul li {
  width: 100%;
  height: 30px;
  min-width: 480px;
  margin-bottom: 20px;
}
.content ul li .inputs{
  width: 200px;
  height: 30px;
}
.btn_box {
  width: 480px;
  margin-top: 110px;
  text-align: center;
}
